function initLvl2Nav() {
if (dObj.breakpoint === 'breakpoint-xs' || dObj.breakpoint === 'breakpoint-sm') {
return;
}
// Nav level 2 and 3 can be centered in relation to Daimler Logo via css class lvl2-nav-centered
// default centering is between button elements left and right from navigation
var isCentered = $('.lvl2-nav-wrapper').hasClass('lvl2-nav-centered');
var funnelWidth;
var searchWidth = 0;
$('#lvl3Nav .navigation').css('margin-left', '0');
//alert('lvl2 + lvl3 nav position berechnen');
var lvl2NavWidth = $('#lvl2Nav .lvl2-nav-content').width();
var lvl2NavContentWidth = $('#lvl2Nav .lvl2-nav-content .navigation').width();
var lvl3NavWidth = $('#lvl3Nav .lvl3-nav-content').width();
var lvl3NavContentWidth = $('#lvl3Nav .lvl3-nav-content .navigation').width();
funnelWidth = $('#lvl2Nav .funnel').width();
var calcNavPosLvL2 = 0;
var calcNavPosLvL3 = 0;
if (!isCentered) {
searchWidth = $('#lvl2Nav .search').width();
calcNavPosLvL2 = (lvl2NavWidth - (funnelWidth + searchWidth) - lvl2NavContentWidth) / 2;
calcNavPosLvL3 = (lvl3NavWidth - (funnelWidth + searchWidth) - lvl2NavContentWidth) / 2 + funnelWidth + (lvl2NavContentWidth - lvl3NavContentWidth) / 2;
} else {
calcNavPosLvL2 = (lvl2NavWidth - lvl2NavContentWidth) / 2 - funnelWidth;
calcNavPosLvL3 = lvl3NavWidth / 2 - lvl3NavContentWidth / 2;
}
//$('#lvl2Nav .navigation').css('margin-left', calcNavPosLvL2);
$('#lvl3Nav .navigation')
.css('margin-left', calcNavPosLvL3)
.delay(200)
.queue(function () {
$(this).addClass('positioned');
});
}
