function initIframeLayer() {
/*
* iframeLayer
*/
var iframeArray = [];
var widthModifier = 40;
var iframeHeight;
var iframeWidth = jq(window).width() - widthModifier;
var screenHeight = jq(window).height() - widthModifier;
jq('.iframeLayerLink').each(function (index) {
var $this = jq(this);
var pagePos;
var scrollSelector = 'html,body';
if (jq('html').hasClass('touch')) {
scrollSelector = 'body';
}
var layerId = $this.data('layer-id');
var layerHead = $this.data('layer-head');
var layerTarget = $this.data('layer-target');
var layerContent = '<div class="iframe-layer iframe-loading" id="layerContainer_' + layerId + '" style="width:' + iframeWidth + 'px;">';
layerContent += ' <div class="iframe-loading"></div>';
if (layerHead) {
layerContent += ' <div class="layer-head"><h2>' + layerHead + '</h2></div>';
}
layerContent += ' <div class="iframe-wrapper" id="' + layerId + '"></div>';
layerContent += '</div>';
//jq('body').append(layerContent);
iframeArray.push(layerContent);
$this.fancybox({
fitToView: false,
topRatio: 0,
type: 'inline',
arrows: false,
closeBtn: true,
//content : jq('#layerContainer_'+layerId),
content: iframeArray[index],
width: '100%',
height: screenHeight,
padding: 0,
wrapCSS: 'info-layer iframelayer',
autoCenter: false,
autoResize: true,
autoSize: false,
scrolling: 'no',
helpers: {
overlay: {
locked: false
}
},
beforeShow: function () {
// before show
/*pagePos = parseInt(jq('html').scrollTop());
console.log(pagePos);*/
jq(scrollSelector).scrollTop(0);
initIframeLayer(layerId, layerTarget);
},
afterShow: function () {
// after show
},
afterClose: function () {
TweenLite.to(jq('#layerContainer_' + layerId).find('.iframe-loading'), 0, { autoAlpha: 1 });
//TweenLite.to(jq('body'),.4,{scrollTop:pagePos, ease:Circ.easeInOut});
TweenLite.to(jq(scrollSelector), 0.4, { scrollTop: pagePos, ease: Circ.easeInOut });
jq.fancybox.close(true);
},
beforeLoad: function () {
// before load
pagePos = jq(scrollSelector).scrollTop();
//alert(pagePos);
},
onUpdate: function () {
iframeWidth = jq(window).width() - widthModifier;
jq('#layerContainer_' + layerId).css('width', '100%');
var currentLayer = $('#' + layerId).closest('.fancybox-wrap');
var currentLayerInner = $('#' + layerId).closest('.fancybox-inner');
resizeLayer(currentLayer, currentLayerInner);
//TweenLite.to(jq('#layerContainer_'+layerId).find('.iframe-loading'), .3, {autoAlpha: 0, delay: 1, ease:Circ.easeInOut});
}
});
});
function resizeLayer(layer, layerInner) {
//console.log('resizeLayer');
var currentLayerHead = layer.find('.layer-head');
var heightModifier = 0;
currentLayerHead ? (heightModifier = currentLayerHead.height()) : (heightModifier = 0);
if (iframeHeight >= screenHeight / 3) {
TweenLite.to([layer], 0.3, { height: iframeHeight + 20 + heightModifier, ease: Circ.easeInOut });
TweenLite.to([layerInner], 0.3, { height: iframeHeight + heightModifier, ease: Circ.easeInOut });
}
}
function initIframeLayer(layerId, target) {
//console.log('initLayer');
var currentLayer = $('#' + layerId).closest('.fancybox-wrap');
var currentLayerInner = $('#' + layerId).closest('.fancybox-inner');
//easyxdm
new easyXDM.Socket({
remote: target,
container: document.getElementById(layerId),
onMessage: function (message, origin) {
//console.log('onMessage');
this.container.getElementsByTagName('iframe')[0].style.height = message + 'px';
this.container.getElementsByTagName('iframe')[0].setAttribute('allowFullScreen', 'true');
iframeHeight = jq('#' + layerId).find('iframe').height();
resizeLayer(currentLayer, currentLayerInner);
},
onReady: function () {
//console.log('onReady');
TweenLite.to(jq('#layerContainer_' + layerId).find('.iframe-loading'), 0.3, {
autoAlpha: 0,
delay: 1,
ease: Circ.easeInOut
});
}
});
}
}
