function initTableHighlight() {
$('.article-table.complex').each(function () {
if ($(this).find('.table-scroll-wrapper').length) {
// fixed col tables
$(this)
.find('.table-complex')
.find('tr')
.each(function () {
$(this).on({
mouseenter: function (event) {
var elemIndex = $(this).index();
var tableParentLocationTemp = $(this).parent()[0];
var tableParentLocation = tableParentLocationTemp;
var helperClass = $(this).attr('class');
$(this)
.parentsUntil('.table-scroller')
.find('.scrollable tr.' + helperClass + ', .pinned tr.' + helperClass)
.addClass('highlight');
},
mouseleave: function (event) {
$(this)
.parentsUntil('.table-scroller')
.find('.scrollable tr, .pinned tr')
.removeClass('highlight');
}
});
});
} else {
// std tables
$(this)
.find('.table-complex')
.find('tr')
.each(function () {
$(this).on({
mouseenter: function (event) {
var elemIndex = $(this).index();
$(this).addClass('highlight');
},
mouseleave: function (event) {
$(this).removeClass('highlight');
}
});
});
}
});
}
