/*
* Basic Count Down to Date and Time
* Author: @mrwigster / trulycode.com
* http://trulycode.com/bytes/easy-countdown-to-date-with-javascript-jquery/
*/
var countdownIntervalTime = 1000;
(function (e) {
e.fn.countdown = function (t, n) {
var thisEl = e(this);
var r = {
endDate: null,
//startDate: null,
serverTime: null,
format: null
};
t && e.extend(r, t);
function i() {
eventDate = r.endDate;
r.serverTime += countdownIntervalTime / 1000;
currentDate = r.serverTime;
var timerSeconds, timerMinutes, timerHours, timerDays, timerHoursTemp, timerSecondsTemp;
if (eventDate <= currentDate) {
// countdown done
thisEl.closest('.countdown').addClass('timer-done');
//n.call(this);
clearInterval(interval);
return;
}
timerSeconds = eventDate - currentDate;
timerDays = Math.floor(timerSeconds / 86400);
timerSeconds -= timerDays * 60 * 60 * 24;
timerHours = Math.floor(timerSeconds / 3600);
//timerHoursTemp = Math.floor(timerSeconds / 3600) + (timerDays*24);
timerSeconds -= timerHours * 60 * 60;
//timerSecondsTemp -= (timerHours-(timerDays*24)) * 60 * 60;
timerMinutes = Math.floor(timerSeconds / 60);
timerSeconds -= timerMinutes * 60;
// text for time reference
if (LANG.code == 'de') {
timerDays == 1 ? thisEl.find('.time-ref-days').text('Tag') : thisEl.find('.time-ref-days').text('Tage');
timerHours == 1 ? thisEl.find('.time-ref-hours').text('Stunde') : thisEl.find('.time-ref-hours').text('Stunden');
timerMinutes == 1 ? thisEl.find('.time-ref-minutes').text('Minute') : thisEl.find('.time-ref-minutes').text('Minuten');
timerSeconds == 1 ? thisEl.find('.time-ref-seconds').text('Sekunde') : thisEl.find('.time-ref-seconds').text('Sekunden');
} else {
timerDays == 1 ? thisEl.find('.time-ref-days').text('day') : thisEl.find('.time-ref-days').text('days');
timerHours == 1 ? thisEl.find('.time-ref-hours').text('hour') : thisEl.find('.time-ref-hours').text('hours');
timerMinutes == 1 ? thisEl.find('.time-ref-minutes').text('minute') : thisEl.find('.time-ref-minutes').text('minutes');
timerSeconds == 1 ? thisEl.find('.time-ref-seconds').text('second') : thisEl.find('.time-ref-seconds').text('seconds');
}
if (timerDays >= 1) {
thisEl.parent().addClass('show-days');
timerDays == 1 ? thisEl.find('.time-ref-days-short').text('d') : thisEl.find('.time-ref-days-short').text('d');
timerHours == 1 ? thisEl.find('.time-ref-hours-short').text('h') : thisEl.find('.time-ref-hours-short').text('h');
if (LANG.code == 'de') {
timerDays == 1 ? thisEl.find('.time-ref-days').text('Tag') : thisEl.find('.time-ref-days').text('Tage');
timerHours == 1 ? thisEl.find('.time-ref-hours').text('Stunde') : thisEl.find('.time-ref-hours').text('Stunden');
} else {
timerDays == 1 ? thisEl.find('.time-ref-days').text('day') : thisEl.find('.time-ref-days').text('days');
timerHours == 1 ? thisEl.find('.time-ref-hours').text('hour') : thisEl.find('.time-ref-hours').text('hours');
}
}
if (r.format === 'on') {
timerDays = String(timerDays).length >= 2 ? timerDays : '0' + timerDays;
timerHours = String(timerHours).length >= 2 ? timerHours : '0' + timerHours;
timerMinutes = String(timerMinutes).length >= 2 ? timerMinutes : '0' + timerMinutes;
timerSeconds = String(timerSeconds).length >= 2 ? timerSeconds : '0' + timerSeconds;
}
if (!isNaN(currentDate)) {
thisEl.find('.days-wrap .days').text(timerDays);
thisEl.find('.hours-wrap .hours').text(timerHours);
thisEl.find('.minutes-wrap .minutes').text(timerMinutes);
thisEl.find('.seconds-wrap .seconds').text(timerSeconds);
} else {
//alert("Invalid date. Example: 10 December 2014 18:00:00");
clearInterval(interval);
}
}
i();
var interval = setInterval(i, countdownIntervalTime);
};
})(jQuery);
String.prototype.MySQLDateToJavascriptDate = function () {
var resTmp = this.split(' ');
var resDate = resTmp[0].split('-');
var resTime = resTmp[1].split(':');
return new Date(parseInt(resDate[0]), parseInt(resDate[1] - 1), parseInt(resDate[2]), parseInt(resTime[0]), parseInt(resTime[1]), parseInt(resTime[2]));
};
