/*
* sticky elements in right sidebar
* eg. on job offer detail page
* or as sticky button - goto top
*/
function count(elem, startCount, targetCount, countDuration, useDecimalPlaces) {
var countStart = !startCount ? '0' : startCount; // if startCount is empty use 0
var countEnd = targetCount;
var decimals = 0;
if (useDecimalPlaces) decimals = countDecimals(countEnd);
if (!countDuration || countDuration == '0') {
setCounter();
} else {
duration = countDuration / 1000;
startCounter();
}
function startCounter() {
var Cont = { val: countStart },
NewVal = countEnd;
TweenLite.to(Cont, duration, {
val: NewVal,
roundProps: 'val',
onUpdate: function (e) {
var formatedNumber = new Intl.NumberFormat(LANG.code, {
minimumFractionDigits: decimals,
maximumFractionDigits: decimals
}).format(Cont.val);
elem.find('.count-nr-content').text(formatedNumber);
}
});
}
function setCounter() {
var formatedNumber = new Intl.NumberFormat(LANG.code, {
minimumFractionDigits: decimals,
maximumFractionDigits: decimals
}).format(targetCount);
elem.find('.count-nr-content').text(formatedNumber);
}
function countDecimals(value) {
if (Math.floor(value) == value) return 0;
return value.toString().split('.')[1].length || 0;
}
}
