function initLvl4Nav(resized) {
/* remove line under header if LVL4 nav is on page */
if(jq('#lvl4Nav').length){
jq('header').css('border-bottom','none');
}
var lvl4NavWidth = jq('#lvl4Nav .lvl4-nav-content').width();
var lvl4NavElemsContainer = jq('#lvl4Nav .lvl4-nav-content .navigation');
var lvl4NavElemsList = lvl4NavElemsContainer.find('ul');
var lvl4NavElemsCount = lvl4NavElemsContainer.find('ul li').length;
var lvl4NavControls = lvl4NavElemsContainer.find('.nav-controls');
var lvl4SingleElemWidth;
var navElemPadding = 50;
var maxWidth = 0;
var truncateCount = 35; //TZ change
var elemsCountModifier = jq(window).width() >= dObj.breakpointLG ? 5 : 4; //TZ change
//var elemsCountModifier = 4; //TZ change
var isAnimating = false;
var scrollWidth;
lvl4NavElemsContainer.find('li').css('width','auto');
lvl4NavElemsContainer.find('li').each(function(){
var navElemText = jq(this).find('a').text();
if(navElemText.length > truncateCount){
var truncateText = navElemText.substring(0, truncateCount - 2) + '...'; //TZ change
jq(this).find('a').text(truncateText);
}
if (jq(this).width() + navElemPadding > maxWidth) {
maxWidth = jq(this).width() + navElemPadding;
}
});
var lvl4NavElemsCompleteWidth = lvl4NavElemsCount * (maxWidth + navElemPadding);
//var showNavBtns = lvl4NavElemsCompleteWidth > lvl4NavWidth ? true : false;
var showNavBtns = lvl4NavElemsCount>elemsCountModifier ? true : false;
if(showNavBtns){
// show controls
lvl4SingleElemWidth = parseInt((lvl4NavWidth - lvl4NavControls.width()) / elemsCountModifier);
lvl4NavElemsContainer.find('ul').width(parseInt(((lvl4NavWidth - lvl4NavControls.width()) / elemsCountModifier)*lvl4NavElemsCount));
lvl4NavElemsContainer.find('li').width(lvl4SingleElemWidth);
lvl4NavControls.css('display', 'inline-flex');
scrollWidth = lvl4SingleElemWidth;
} else {
// don't show controls
lvl4SingleElemWidth = parseInt(lvl4NavWidth / lvl4NavElemsCount);
lvl4NavElemsContainer.find('ul').width(lvl4SingleElemWidth*lvl4NavElemsCount);
lvl4NavElemsContainer.find('li').width(lvl4SingleElemWidth);
scrollWidth = lvl4SingleElemWidth;
lvl4NavControls.css('display', 'none');
if(parseInt(lvl4NavElemsList.css('margin-left')) < 0){
lvl4NavElemsList.css('margin-left','0');
}
}
TweenLite.to(jq('#lvl4Nav'), 0.2, {autoAlpha: 1, ease:Circ.easeOut});
/*** nav controls ***/
var scrollabe = false;
lvl4NavElemsContainer.find('.nav-controls div').off().on({
click: function(event) {
if (isAnimating) {
event.preventDefault();
event.stopImmediatePropagation();
return;
} else {
if (this.classList.contains('nav-next')) {
if (countLeft < (lvl4NavElemsCount - elemsCountModifier)) {
countLeft++;
scrollabe = true;
isAnimating = true;
} else {
scrollabe = false;
}
} else {
if (countLeft > 0) {
countLeft--;
scrollabe = true;
isAnimating = true;
} else {
scrollabe = false;
}
}
// scrollLvl4
if (scrollabe == true) {
TweenLite.to(lvl4NavElemsList, .3, {
marginLeft: -countLeft * scrollWidth,
ease: Circ.easeOut,
onComplete: function() {
isAnimating = false;
}
});
if (countLeft == 0) {
lvl4NavControls.find('.nav-prev').addClass('disabled');
lvl4NavControls.find('.nav-next').removeClass('disabled'); //TZ add
} else if (countLeft == (lvl4NavElemsCount - elemsCountModifier)) {
lvl4NavControls.find('.nav-next').addClass('disabled');
lvl4NavControls.find('.nav-prev').removeClass('disabled');
} else if (0 < countLeft < (lvl4NavElemsCount - elemsCountModifier)) {
lvl4NavControls.find('.nav-prev').removeClass('disabled');
lvl4NavControls.find('.nav-next').removeClass('disabled');
}
}
}
}
});
if (showNavBtns && !resized) {
lvl4NavControls.find('.nav-prev').addClass('disabled');
// scroll to active nav if after 4th position
lvl4NavElemsContainer.find('li').each(function(i) {
i++;
if (this.classList.contains('ln-active') && i > elemsCountModifier) {
i--;
countLeft = i - elemsCountModifier;
lvl4NavControls.find('.nav-next').trigger('click');
}
});
}
if (resized) {
TweenLite.to(lvl4NavElemsList, .3, {
marginLeft: -countLeft * scrollWidth,
ease: Circ.easeOut,
onComplete: function() {
isAnimating = false;
}
});
}
}
