function initCounterOrAnimation(){
jq.fn.isInViewport = function() {
var elementTop = jq(this).offset().top;
var elementBottom = elementTop + jq(this).outerHeight();
var viewportTop = jq(window).scrollTop();
var viewportBottom = viewportTop + jq(window).height();
return elementBottom > viewportTop && elementTop < viewportBottom;
}
jq('.count-nr').not('.counter-started').each(function(){
if (jq(this).isInViewport()) {
if(!jq(this).hasClass('counter-started')){
count(jq(this), jq(this).data('count-start'), jq(this).data('count-end'), jq(this).data('count-duration'), jq(this).data('decimals'));
jq(this).addClass('counter-started');
}
}
});
jq('.canvas-chart').not('.animation-run').each(function(){
var $chart = jq(this);
var chartId = $chart.find('canvas').attr('id');
if(dObj.chartInstances[chartId] === undefined){
return;
}
if ($chart.isInViewport()) {
if(!$chart.hasClass('animation-run')){
dObj.chartInstances[chartId].destroy();
dObj.initCharts(chartId);
//dObj.chartInstances[chartId].update();
$chart.addClass('animation-run');
}
}
});
}
